import React from "react";

function Summary() {
    return (
        <div className="summary">
            <div className="summaryTitle">Clicky Memory Game!</div>
            <div className="summaryText">Try to click through all of the images without clicking one that you have already chosen.</div>
            <div className="summaryText summaryEnd">Go for the top score of 12!</div>
        </div>
    );
};

export default Summary;
